import { useEffect, useRef, useState } from "react";

  var clicked = false;
export default function Navbar(){
  let navtext = "";
    var inputRef = useRef(0);
    let [x_screen,setX_screen] = useState(0) ;
    useEffect(() => {
      setX_screen(window.screen.availWidth);
    })

    if(x_screen <= 600) {
      navtext = "inline-grid space-x-5"
      var button = document.getElementById("minmax")
      button.style.visibility = "hidden";
      
    }else{
      navtext = "flex space-x-5"
      var button = document.getElementById("minmax")
      button.style.visibility = "hidden";
    }
    return(

        <nav className="w-full bg-black">
        <ul className={navtext} ref={inputRef} >
        <button id="minmax" className="pl-5 left-0 text-left" >|||</button>
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/myprojects">My Projects</a></li>
          <li><a href="/blogs">Blogs</a></li>
        </ul>
      </nav>
        
    );
}
